% Use the Matlab guihandles() function to generate the handles from the
% figure, using the control Tag properties to get the field names.
% Then stash that in the figure guidata.
handles = guihandles(main_figure);
% handles_original = handles ;
%guidata(main_figure, handles) ;  % stash the handles

% Call the initialization function (now inlined)
%dispatchMainFigureCallback('initialize', h1, [], handles) ;

% if labeler.isgui ,
%   hfigsplash = createSplashScreenFigure();
% end

main_figure.Name = 'APT';
main_figure.HandleVisibility = 'on';

% delete unused stuff from toolbar
hs = findall(main_figure,'type','uitoolbar');
KEEP = {'Exploration.Rotate' 'Exploration.Pan' 'Exploration.ZoomOut' ...
  'Exploration.ZoomIn'};
hh = findall(hs,'-not','type','uitoolbar','-property','Tag');
for hs=hh(:)'
  if ~ishandle(hs),
    continue;
  end
  if ~any(strcmp(hs.Tag,KEEP))
    delete(hs);
  end
end

